int perform_inference(image_t* image) {
    float max_output = 0;
    int predicted_class = 0;
    int i, j;  // Declare loop variables

    // Perform inference for each output class
    for (i = 0; i < 10; i++) {
        float sum = biases[i];

        // Compute weighted sum
        for (j = 0; j < 784; j++) {
            sum = sum + (image->pixels[j]*weights[i][j]) / 784.0f;
        }

        // Update prediction if this output is higher
        if (sum > max_output) {
            max_output = sum;
            predicted_class = i;
        }
    }

    return predicted_class;
}

void prediction(image_t* image){
    int predicted_digit = perform_inference(image);
    printf("Predicted Digit: %d\n", predicted_digit);
    printf("Actual Digit: %d\n", image->label);
    return;
}

void get_images(int index){ //extract test images from CSV. index paramter determines how many images to store in image_t* struct
    char buffer[2048];
    int row = 1;
    int column = 1;
    int i = 0; //for iterations. i for pixel iteration, j for dataset iteration
    int j = 0;
    bool firstRow = false;
    int num;

    image_t image;

    FILE* fp = fopen("mnist_test.csv", "r"); //opens csv file
    if(fp == NULL){ //if the file can't open, exit program        printf("Can't open file\n");
        exit(1);
    }

    while(fgets(buffer, 2048, fp) != NULL){
        if(!firstRow){ //skips the first row with all the descriptions
            if(strstr(buffer, "\n") != NULL){
                firstRow = true;
            }
            //printf("%s\n", buffer);
            continue;
        }

        else{
            //printf("Image %d:\n", row);

            char* value = strtok(buffer, ","); //splits csv data based on commas

            while(value != NULL){
                num = atoi(value); //convert string token into an integer value
                if(column == 1){
                    //printf("%d\n", num);
                    image.label = num;
                    //printf("Label: %d\n", image.label);
                }

                else{
                    //printf("%d\n", num);
                    image.pixels[i] = num;
                    //printf("Pixel %d: %d\n", i, image.pixels[i]);
                    i++;
                }

                value = strtok(NULL, ","); //goes to next string token
                column++;
            }
            if(j == index-1){
                printf("Image %d loaded\n", row);
                image_t* image_p = &image;
                prediction(image_p); //prediction function;
                return; //once the index value is reached, exit function
            }
            i = 0;
            column = 1;
            row++;
            j++;
        }

    }
}

int main(void)
{
    WDTCTL = WDTPW | WDTHOLD;   // stop watchdog timer

    printf("Test\n");

    get_images(1); //tests specific images from the test dataset
    get_images(2);
    get_images(22);
    get_images(6);
    get_images(9);
    get_images(10);
    get_images(65);
    get_images(12);
    get_images(37);
    get_images(41);

    printf("Done\n");

    return 0;
}

